import "./Bid.css"
function Bid(props){
    console.log(props.pro)
    return(
        <div>
            <table className="t1 t3">
                <thead>
                <tr className="t1 t3">
                    <th>Product Image</th><th>Product Name</th><th>Category</th><th>Base Bidding</th><th>End Date</th>
                </tr>
                </thead>
                <tbody>
                {
                    props.pro.map(s=>{
                        return(
                            <tr className="t2" key={s._id}>
                                <td>
                                    <img src={`http://127.0.0.1:4000/${s.image}`}/>
                                </td>
                                <td>{s.product_name}</td>
                                <td>{s.category_name}</td>
                                <td>{s.base_bid}</td>
                                <td>{s.bid_end}</td>
                            </tr>
                            )
                    })
                  }
                </tbody>
            </table>
        </div>
    )
}
export default Bid;
